import { ADD_DAY, ADD_CATEGORY, ADD_CELL } from "../actionTypes"
import {today} from "../../components/Today"

let dayId = today

const initialState = {
    days: [],
}

export default function(state = initialState, action) {
    switch(action.type) {
        case ADD_CATEGORY:
            return {
                ...state,
                days: [...state.days,
                {
                    dayId: dayId,
                    category: action.payload
                }]
            }

        default:
            return state
    }
}
